import React, { useState, useEffect } from "react";
import { MapContainer, TileLayer, useMap, Marker, Popup } from 'react-leaflet'
import 'leaflet/dist/leaflet.css'
import SearchForm from "./SearchForm";

const Map = () => {

    
    const [graphData, setGraphData] = useState([]);
    console.log(graphData[0]);
    const position = [graphData[0].latitude, graphData[0].longitude];


  return (
    <div>
      <h1>Healthcare Data Visualization with GraphXR</h1>
      <SearchForm setGraphData={setGraphData} />
      <MapContainer center={position} zoom={13} scrollWheelZoom={false} style={{height: 900}}>
    <TileLayer
      attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
      url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
    />
    <Marker position={position} >
      <Popup>
        A pretty CSS3 popup. <br /> Easily customizable.
      </Popup>
    </Marker>
  </MapContainer>,
    </div>
  );
};

export default Map;
